public ByteBuffer getTokensConf() {
  ContainerLaunchContextProtoOrBuilder p = viaProto ? proto : builder;
  if (this.tokensConf != null) {
    return this.tokensConf;
  }
  if (!p.hasTokensConf()) {
    return null;
  }
  this.tokensConf = convertFromProtoFormat(p.getTokensConf());
  return this.tokensConf;
}
